import React, { useState } from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import { AppBar, Toolbar, Typography, Button, Container, Box, List, ListItem, ListItemText, IconButton } from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";
import LoginPage from "./components/LoginPage";
import ReservationForm from "./components/ReservationForm";
import ReservationList from "./components/ReservationList";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [username, setUsername] = useState("");
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const handleLogin = (username) => {
    setIsLoggedIn(true);
    setUsername(username);
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    setUsername("");
  };

  const toggleSidebar = () => {
    setSidebarOpen(!sidebarOpen);
  };

  return (
    <Router>
      <div>
        {/* Navigation Bar */}
        <AppBar position="sticky">
          <Toolbar>
            {/* Menu Icon */}
            {isLoggedIn && (
              <IconButton edge="start" color="inherit" onClick={toggleSidebar} sx={{ marginRight: 2 }}>
                <MenuIcon />
              </IconButton>
            )}
            {/* Title */}
            <Typography variant="h6" sx={{ flexGrow: 1 }}>
              My Reservation App
            </Typography>

            {/* Login or User Info */}
            {isLoggedIn ? (
              <Button color="inherit" onClick={handleLogout}>
                Logout
              </Button>
            ) : (
              <Button color="inherit" component={Link} to="/">
                Login
              </Button>
            )}
          </Toolbar>
        </AppBar>

        {/* Sidebar */}
        {isLoggedIn && (
          <Box
            sx={{
              position: "absolute",
              top: 64, // Adjusted for the AppBar height
              left: sidebarOpen ? 0 : -250, // Slide in/out effect
              width: 250,
              height: 'calc(100vh - 64px)', // Fill the remaining space below the AppBar
              backgroundColor: "#333#fff", // Dark background for the sidebar
              color: "#fff",
              transition: "left 0.3s ease-in-out", // Smooth transition for sliding
              zIndex: 1200,
              paddingTop: "20px", // Padding for the sidebar content
            }}
          >
            <List>
              <ListItem button component={Link} to="/reservations" onClick={toggleSidebar}>
                <ListItemText primary="Reservations" sx={{ color: "#fff" }} />
              </ListItem>
              <ListItem button component={Link} to="/reserve" onClick={toggleSidebar}>
                <ListItemText primary="Reserve" sx={{ color: "#fff" }} />
              </ListItem>
              <ListItem button onClick={handleLogout}>
                <ListItemText primary="Logout" sx={{ color: "#fff" }} />
              </ListItem>
            </List>
          </Box>
        )}

        {/* Main Content Area */}
        <Box sx={{ marginTop: '64px', marginLeft: sidebarOpen ? '250px' : '0', transition: 'margin-left 0.3s ease' }}>
          <Container>
            <Routes>
              <Route path="/" element={<LoginPage onLogin={handleLogin} />} />
              <Route path="/reservations" element={isLoggedIn ? <ReservationList /> : <LoginPage onLogin={handleLogin} />} />
              <Route path="/reserve" element={isLoggedIn ? <ReservationForm /> : <LoginPage onLogin={handleLogin} />} />
            </Routes>
          </Container>
        </Box>
      </div>
    </Router>
  );
}

export default App;
